import { Link } from "react-router-dom";
import classes from "./AdminControl.module.css";

function AdminControl() {
  return (
    <p>
      <Link to="/admin/addproduct">
        <div className={classes.link}>Add Product</div>
      </Link>
    </p>
  );
}

export default AdminControl;
